import React, { useState } from "react";

const ExpensesFilter = () => {
  return (
    <div className="expenses-filter">
      <div className="expense-filter__control">
        <label>Filter by Year</label>
        <select>
            <option>2019</option>
            <option>2020</option>
            <option>2021</option>
            <option>2022</option>
        </select>
      </div>
    </div>
  );
};

export default ExpensesFilter;
